import React, { useState } from "react";
import './Now.css';

function Now({ text, bgcolor, changeValue }) {
  return (
    <button
      onClick={changeValue}
      style={{
        backgroundColor: bgcolor ? "skyblue" : "pink",
        color: "white",
        fontSize: "20px",
        fontWeight: "bold",
        padding: "10px 20px",
        border: 0,
        borderRadius: 10,
      }}
    >
      {text}
    </button>
  );
}
